import { useCallback } from 'react';
import { useDispatch,useSelector } from 'react-redux';
import SuccessLogin from '../components/SuccessLogin';
import { truelogin } from '../modules/successlogin';
const SuccessContainer = () => {
    const truelogin = useSelector(state => state.success.link );
    const dispatch = useDispatch();
    const onTruelogin = useCallback(()=>dispatch(truelogin()),[dispatch]);
    return(
        <SuccessLogin 
        link={truelogin} 
        onTruelogin={onTruelogin}/>
    );
};

